window.bookSummaryJSON = "<p>The Onlivik Spores have been defeated; the dungeon tamed but at great cost. John and his friends are reeling from the losses, but the countdown to full integration to the System continues.</p> <p>Threatened by System-integrated races and new, more powerful monsters, John will need to get creative if he and the city are to survive.</p> <p><i>The Cost of Survival</i> is the third book of the System Apocalypse series. A LitRPG/GameLit apocalypse book, <i>The Cost of Survival</i> combines modern day life, science fiction, and fantasy elements along with game mechanics.&nbsp;</p>"; 
